import * as httpRequest from "../utils/httpRequest";

export const postAccount = async (formData) => {
    const response = await httpRequest.post(`account/CreateAccount`, formData);
    
    return response;
    try {
    } catch (error) {
        console.log(error.response.data);
        return error;
    }
}
